import { React, useState } from 'react';
import Users from './components/Users';
import Chat from './components/Chat';
import Leftbar from './components/Leftbar';
import { useLocation } from 'react-router-dom';


export default function Homescreen() {
  const location=useLocation() ;

  const {username,password}=location.state || {};
  const [Showchat,setShowchat]=useState(false)
  return (
    <>
    <Leftbar></Leftbar>
    <Users username={username} password={password} ></Users>
    {Showchat}?<Chat></Chat>:{ <div className='h-screen w-192 bg-gray-200 float-right flex justify-center items-center'><span className='text-2xl'>Start Messaging</span></div> }
    </>
  );
}
